Defendant Sharod Christopher Rimmer in court with Attorney Parker Charles Mathers.  Defendant Sharod Christopher Rimmer in custody.  Catelin Ringersma appeared for the State of Wisconsin.

Matter here for Sentencing.  Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statement from Shalonda R.   

The Court imposed the following sentence:   AS TO COUNT #1:  The Defendant's TOTAL LENGTH OF SENTENCE shall be EIGHT (8) years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for THREE (3) years with credit for 190 days time served.  Defendant shall serve FIVE (5) years on EXTENDED SUPERVISION.  

AS TO COUNT #3:  The Court sentenced the defendant to serve SIX (6) MONTHS in the House of Correction CONCURRENT to count #1 with credit for 190 DAYS time served. 

The defendant is not eligible for the Challenge Incarceration Program or the Wisconsin Substance Abuse Program.
  
The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

CONDITIONS OF EXTENDED SUPERVISION:
 - No controlled substances or alcohol; Absolute Sobriety;
 - AODA assessment; treatment, if needed;
 - Urine screens to ensure compliance;
 - Seek and maintain full-time employment;
 - No contact with victim, Devron D, and co-actor, Jeremy Sims;
 - Restitution set at ZERO;
 - Pay the DNA surcharge, costs and disbursements. Court ordered monies taken by the Department of Correction from up to 25% of prison funds.  Balance would be then be paid while on Extended Supervision.  If not paid by end of probationary period, balance converts to a civil judgment.   

Court advised defendant that as a convicted felon he may never possess any gun or other firearms. 
Court advised defendant that his voting rights are suspended, and may not vote in any election until his civil rights are restored.  

Court advised defendant if he is not a citizen of the United States of America, that upon a plea of guilty or no contest for this offense, he could be deported, excluded from admission to his country, or denied naturalization under federal law.  

